### Summary of Core Topics, Concepts, Principles, and Equations

#### Software Testing Concepts
1. **Regression Testing**:
   - **Definition**: Testing conducted after modifying or upgrading software to ensure that the changes have not introduced new defects and that the software still functions as expected.
   - **Purpose**: To verify that the modified component works correctly and that other components are not adversely affected by the modification.

2. **Process Maturity Levels**:
   - **Level 1**: Initial level where processes are ad-hoc and chaotic.
   - **Level 2**: Repeatable level where basic project management processes are established.
   - **Level 3**: Defined level where processes are well-documented and standardized.
   - **Level 4**: Managed level where processes are quantitatively understood and controlled.

3. **Coupling in Software Engineering**:
   - **Definition**: The degree of interdependence between software modules.
   - **Types**:
     - **Common Coupling**: Modules share a common data structure.
     - **Parameter Coupling**: Modules communicate through parameters.
     - **Shared Data Coupling**: Modules share global data.
     - **External Device Coupling**: Modules interact with external devices.

4. **Depth-First Search (DFS)**:
   - **Back Edges**: Edges that connect a vertex to an ancestor in the depth-first tree.
   - **Tree Edges**: Edges that are part of the depth-first tree.
   - **Forward Edges**: Edges that connect a vertex to a descendant in the depth-first tree.
   - **Cross Edges**: Edges that connect vertices that are not directly related in the depth-first tree.

5. **Finite State Machines (FSM)**:
   - **Definition**: A mathematical model of computation used to design computer programs and digital logic circuits.
   - **Components**: States, transitions, and actions.
   - **Example**: An FSM that accepts strings with an even number of 'a's.

6. **Prime Paths and Test Paths**:
   - **Prime Paths**: Simple paths in a control flow graph (CFG) that do not contain nested loops or repeated nodes.
   - **Test Paths**: Paths through a program that are used to test the program's functionality.
   - **Detour and Sidetrip**: A detour is a deviation from a prime path that does not return to the original path, while a sidetrip is a deviation that returns to the original path.

7. **Control Flow Graph (CFG)**:
   - **Definition**: A graphical representation of the control flow of a program.
   - **Components**: Nodes (basic blocks) and edges (control flow paths).
   - **Example**: A CFG with nodes and edges representing the flow of control in a program.

8. **Cyclomatic Complexity**:
   - **Definition**: A software metric that provides a quantitative measure of the logical complexity of a program.
   - **Formula**: \( V(G) = E - N + 2P \), where \( E \) is the number of edges, \( N \) is the number of nodes, and \( P \) is the number of connected components.

9. **DU-Pairs and DU-Paths**:
   - **DU-Pair**: A pair consisting of a definition of a variable and a subsequent use of that variable.
   - **DU-Path**: A path from a definition of a variable to a use of that variable.

10. **Test Coverage**:
    - **Node Coverage**: Ensuring that every node in the CFG is executed at least once.
    - **Edge Coverage**: Ensuring that every edge in the CFG is executed at least once.
    - **Prime Path Coverage**: Ensuring that every prime path in the CFG is executed at least once.

#### Equations

1. **Cyclomatic Complexity**:
   \[
   V(G) = E - N + 2P
   \]
   - \( E \): Number of edges in the CFG.
   - \( N \): Number of nodes in the CFG.
   - \( P \): Number of connected components in the CFG.

2. **DU-Pairs and DU-Paths**:
   - **DU-Pair**: \((d, u)\), where \(d\) is a definition of a variable and \(u\) is a use of that variable.
   - **DU-Path**: A path from \(d\) to \(u\) in the CFG.

